values:
&nbsp;Lately it seems I have been trying to live in Lorelei's head.&nbsp;

&nbsp; Lorelei. My heroic character who is everything I am not. Ever since I can remember I have always created characters that are my complete opposite. They always possess the personalities I wish I had. Some would think this is foolish. Would it not be easier to write a character with my same traits since those traits are the ones I am familiar with?

&nbsp; Regardless, I love Lorelei as if she were a real person. She has become my lifeline more than once. Anytime something goes wrong in my life or I am upset I tend to turn toward this character as if she can save me. But how can she? She is just my imagination.

&nbsp; Sometime ago a friend tried to comfort me during my emotional slump I had back in summer while I was still in college. I remember sitting in class waiting for Religion to start when I received a text message from this friend. She said that I will make it through because I am Lorelei. (If you read this you will know who you are.) I think in some small way that has changed me. Despite our conflicting characteristics, yes, I am Lorelei. With each character we create we put a small part of ourselves in those characters. We soon become like a small family. So I begin to realize I do have a lot in common with Lorelei.

&nbsp; Like her I am strong. The both of us have been through a lot and it has made us both survivors. We are both not afraid to stand our ground. We wholey trust our beliefs and never question them. We are hesitant to make committed relationships because we are independant, but also afraid of hurting the ones we do love. I made her Irish because I love the Irish. We appreciate the deep richness of their culture.&nbsp;
&nbsp;
&nbsp; The more thought I put into our likeness I realize she is my shadow. She is me only she has a different name and lives in a different time.

&nbsp; Now this may just be the crazy ramblings of someone who spends more time in solitude than in the company of others, but they mean something to me and that is all that matters.

&nbsp;&nbsp; A local farmer was asked recently why the ants in our area were not builiding mounds and he replied it meant that we were going to have a bad winter. Instead of building mounds they are stocking up on food. I have never seen ants act this way before. I just thought they were acting odd because of the drought we have been having. But I suppose not.

&nbsp; Then last night after killing a spider eariler that was crawling across my bedroom floor I was almost afraid to sleep in my bed. I really truly hate spiders and the thought of getting bit by one in my sleep made&nbsp; me restless. Plus, my mind was in the state of trying to sort dreams from reality. They can get so easily confused. So simply to say I did not sleep well last night.

&nbsp; I&nbsp;have admittedly been rather boring as of late. No writing, hardly&nbsp;any reading, and just a little crafting. Instead, I will lay on my bed for several hours dozing on and off. Am I really&nbsp;so tired? Or is my mind in such a sluggish state that I am having a hard time getting some stirring of creativity to arouse itself? Or is that just me being lazy?

&nbsp;&nbsp;This weekend I did manage to accomplish a little in the way of things. Since I had the weekend off I went to see my grandmother Saturday and we ate dinner together and then watched 3:10 to Yuma. Okay, this past Saturday had pretty much been planned all week long. Somehow Brittany and I managed to go to showings of the movie ten minutes apart and&nbsp;had a squeeful time once it was finished. Then Sunday I figured out a way to make&nbsp;handmade drink coasters. All I'm doing is taking small pieces of&nbsp;octogonal wood I found on clearance at Wal-mart for 50 cent and painting them. Once I get finished I'm going to find some&nbsp;water resistant shelac to seal them with and voila! Coasters. :D I also finished my secret anniversary present for my dearest. Now I just hope I can&nbsp;find a box to put it in. The next project I have in mind is a picture collage of Ireland. Anyone who sees my room will notice it has an Irish theme to it. Over the years I have collected tons of magazine, calendars, etc containing&nbsp;pictures of Ireland. I've been trying to&nbsp;come up with a way to display them so then I had the idea for the collage. Before I even do any glueing I bought a piece of posterboard to get a layout for my collage first. Once that is done I'm going to buy a nice piece of carboard posterboard for the final. I'm hoping it will turn out nice. Tomorrow I think I'm going to start picking out what pictures I wish to&nbsp;use then start on the layout.

&nbsp;&nbsp;Now if I can only get as much writing done as I do crafting all would be well.

&nbsp; Also on Sunday I watched on older Russell Crowe movie I managed to find in the $5 bin at Wal-mart. The storyline was decent, RC a little crazy, but I nearly fell out of my chair when there was&nbsp;a nude scene of him shot from behind. I managed to break from the rp Brittany and I were currently&nbsp;enacting long enough to scream "I just saw RC's butt. O_o" Seriously, dear. I think when you come down for my birthday, and sense Boo and Brew is not happening, we should make Friday&nbsp;our RC movie day. XD&nbsp;

Wow. That felt sinful.
&nbsp;&nbsp;
&nbsp;

&nbsp; The paper is done!

&nbsp; And to make sure I was rid of it I tossed it onto the teacher's desk in the classroom because I no longer wanted to be in possession of the thing that caused me grief.

&nbsp;

&nbsp; I'm being a bad girl today and skipping Economics. Why? Because I completely forgot about a 3 to 4 page paper that is due tomorrow. I never did my research. So now I'm cramming and trying to find various information on book publishing companies for my paper. Its for Statistics and therefore must have lots of numbers. I'm slowly growing depressed over this. First, because I'm having a hard time finding information. Second, because I have never so blatantly forgotten a project. Thirdly, I've never skipped class. If I didn't have to work this afternoon I wouldn't have, but alas I do have to work. Plus, with my religion class tonight I have very limited time today.
&nbsp; I'm considering committing the most absolute sin for myself though. I'm thinking about skipping Religion as well. By all means I do not want to stay up till some crazy hour in the morning writing my paper. Plus, I want to have the time to write so I can make it sound good. When it comes down to it I would rather sacrafice two classes than to fuck up a grade. -_-&nbsp;
&nbsp; How could I have been so absentminded?
&nbsp; If I'm&nbsp; not mistaken I only have 2 weeks of classes and then exams left.
&nbsp; Anyways, I think I have gotten as much as I could from the net for this paper. I can always use my Writer mags at home because they always have information on publishers. Ugh. *bangs head on desk repeatedly*

&nbsp;Aside from my school drama the trip was great. Friday we were super lazy. Except we did manage to go get the food required for Skyline chilli. That night we watched lots of Jack of All Trades and stuffed ourselves. Saturday we left for Myrtle Beach at 10 and got there around 12. Since it was too early to check in to our hotel we went by Broadway at the Beach and ate lunch at Amici's (the place with the great brick oven pizza). Then it was shopping! I got myself a nice new purse. (Haven't bought one since the Vera purse I bought last year.) I managed to drag Brittany into Magiquest. Oh my gosh! So much fun! When you first walk in you are asked to select a wand. They offered 3 different colors. Once you chose your wand you chose which clan you wish to be in. Each clan had certain strengths, weaknesses, and magical powers. Once all of that was taken care of you filled out this sheet asking your real name, etc. You also had to list what your game name was going to be. I put Lorelei of course. :P Then it was time to pay up. For the wand, which you keep, and a 60 minute game was $25. Of course, we had to go through a magic training course. (Flick those wands just so!) Finally, it was time to play.
&nbsp; Simply put Magiquest is a video game in which you take part. Basically live role playing in a sense. You go on quests, collect treasure, find gold, and even gain experience points. The hilarious part of it all though was Brittany and I were the oldest ones in there playing. XD
&nbsp; Once our game was done we finally left to check into our hotel. It was Brittany's first experience with a bellhop. Quite amusing. As soon as the bellhop unloaded out cart in our room it was off to Barefoot Landing to eat at Dick's Last Resort. The best restuarant ever as far as entertainment goes. She relates that story over in her own journal. :)&nbsp;
&nbsp; The rest of the evening was...well...pirvate time. We spent awhile one the beach and were amazed at how crowded it still was at 1 am. And what she did for me afterwards was incredibly sweet. I felt like the most special person in the world.&nbsp;
&nbsp; The next morning we checked out, which was an adventure in itself, and went to eat lunch on a pier. We sat outside and the weather was so wonderful and so was the food. Later we bounced around the Gay Dolphin then back to Broadway at the Beach to do a little more shopping. We also went to the Ripley's Aquarium where Brittany finally got to see her Leafy Seadragon. It was so cute how she squeed over them. :) We were going to pet the stingrays, but everyone else had the same idea. So we went to play with the horseshoe crabs instead.
&nbsp; Once we grew bored with the aquarium we walked around some more and ate dinner at Blarney Stones. It was an Irish pub and kinda disappointing. It wasn't traditional in the sense of playing Irish music and the sort, but they did have authentic food. We both tried out Sheperd's pie which was yummy, but we couldn't eat it all. After dinner was ice cream and then we had to face the reality of coming home. That is the part neither one of us enjoy
&nbsp; The rest is rather depressing.&nbsp;
&nbsp; Goodness, I have managed to get myself sidetracked again. Focus, Kiera, focus. Argh.

&nbsp;&nbsp; Needless to say after having a week free from school has really screwed up my motivation to sit through any of my classes. And ever since Monday I have gone back to writing during Economics. That is the only class in which I'm completely insubordinate. I don't pay attention, don't read the chapters, and I write during class. I should sincerely be ashamed of myself. But I'm not. :P Its my rebellious pirate side taking over.
&nbsp;&nbsp;&nbsp;
&nbsp; My break was really nice. It gave me a chance to get out and run around and be random. And random I was. From the work schedule I had starting that week I knew I only had Tuesday off and being unsure of whether or not I would get anymore weekdays off I seized upon an idea. Go to the beach for a day Tuesday! Of course, I was going to drag the family with me, but I first had to find out if they wanted to go or not. It didn't take much persuasion to get them excited. So at 8 o'clock Tuesday morning we made our way to the beach. We would have arrived earlier if it weren't for mom wanting to stop and eat breakfast. We arrived at the beach at about 11:30. The traffic in Conway and entering Myrtle Beach was awful. And I was driving. XD&nbsp;&nbsp;
&nbsp; Anyways, it turned out to be a great day that didn't last long enough. We spent some time at Barefoot Landing, a shopping center, because I wanted mom to see the tigers but they weren't going to be open till 5 that night. So we opted for a little show called Ghosts and Legends. Might I say hilarious? My mom, sis, and I were the only 3 people in the room where the show was being held. Everything was animated to move on its on and the ghosts were represented by spotlights which I thought wa s neat idea. We laughed (mostly at my sister), jumped, and got wet. Yes, wet. Later on we went to Broadway at the Beach (which I still have a hard time finding) and mom payed our way in to the 3D Imax theater. We went on a safari which I found fun. Not much shopping though because the afternoon was growing late and we wanted to hit the beach. (Anyone heard of that marine joke?) Then after&nbsp;a few hours on the beach we went back to Broadway to go to the Ripley's Aquarium . Initially we were not going to go to the aquarium till we saw a sign that simple said "Pirates!" advertised by the aquarium. XD We were sold.&nbsp;
&nbsp; The rest of the week was sort of bland after that. I actaully got the chance to see fireworks on the 4th for the first time since I was like 12. My sister's boyfriend took us to a lake called the Wateree to watch the fireworks. Its was absoultely wonderful there. The views of the lake were beautiful. (Then I realized I couldn't seem to stay away from large bodies of water. XD) What was also neat was right next the parking lot and marina we were in there was a recreation park for the family and servicemen at the Shaw Air Force Base. They had music and all sorts of fun going on. However, the fact that the man singing kept singing Melissa Etheridge(?) songs was too funny. Cause she is gay. XD Anyways, the fireworks were decent and it was a nightmare trying to get out of the place because it was so crowded and you had trucks going down to the dock to load up their boats so it created a huge traffic jam. But we did get home okay.
&nbsp; Work has had its share of drama...sort of. Sherra was made Assistant Manager while Diane relunctantly took Manager. At first I thought it was just a rumor, but eventually found out that it was true. Admittedly, at first I was disappointed. That was the 3rd time in my nearly 3 years there that I had been duped from a managment position. But then like usual I got to thinking. I'm going to be leaving soon and I'm in school so there is really no purpose for me to be in such a position when I couldn't fulfill the role and demand. So then I was okay with it. I worked with Sherra Monday afternoon and we got to talking about Roy because he put in his two weeks notice. He is mainly quitting because he thought we was going to get the position and since Sherra got it he was not going to take commands from her. Then we had a heart to heart. Sherra told me she didn't want any hard feelings. She told me that when Diane approached her with the position the first person she thought about was me. So we talked on about that and got ourselves sorted out to where there are no hard feelings. I actually felt better when she told me.
&nbsp; So with all of that aside....and wow its quite the mouth full. I'm working&nbsp;on a fun little story that actaully began as a half crazed dream. When I say half crazed I mean...this i what happens when you are not feeling well, that feverish sick kinda daze, and watching Master and Commander before going to bed. NOT giving out all the details. You will have to wait till its done. More like not everyone. Cion is soooo impatient. XD But yes, once its done it will be posted. I'm crossing my fingers for the end of the week, but I don't know yet. I still have a long way to go. Luckily, I have today off and little homework so...I'm gonna write!
&nbsp; Also, I'm wanting a new mood theme to go along with my new journal layout. I'm either going to see if I can find a premade POTC theme or I will need to make my own. I've never made my own and don't know how. Could someone tell me....please?

I'm back!

Tomorrow I will have a better somewhat detailed entry of my summer break, but till then I will say it was quite a rollercoaster.&nbsp;

So now its back to getting used to the college grind.&nbsp;

Anyways, I've got to be off to work . Ugh. Then go home and do homework. Once all of that is done I can finally jot down all my new Ben and Lorelei ideas that are clase to making my head want to explode. O_o
